import React from 'react';
import "./Form.css";

const AlexanderNeumann = (props) => {
    return (
        <span>
            <h4> Alexander Neumann is a 27 year old graphic designer and developer of this Front-End Challenge.
                In his graphic design work, he has worked for <a href="https://en.wikipedia.org/wiki/Christopher_Wylie"
                    target="_blank">Christopher Wylie</a>, and developed his own block stacking game,<a
                        href="https://vimeo.com/648414048" target="_blank">Misfits</a>. In a front-end capacity,
                he worked for EdAid, created a dashboard for current conditions in London, UK, and recently completed a 6 month Software Engineering Immersive with General Assembly.
            </h4>
        </span>
    )
}
export default AlexanderNeumann;
